Year 1342 ( MCCCXLII ) was a common year starting on Tuesday ( link will display the full calendar ) and a continuation of the year 1338 (
MCCCCLII
). It is the 130th year since the establishment of the modern era ( AD 952 ) and the 114th since the end of the Common Era (CE). The year 1342 ended on Monday (link will display the full calendar ). The end of the Common Era will be on Friday (
